function linReg(source, length, offset) {
    //linreg = intercept + slope * (length - 1 - offset)
    // intercept and slope calculated least squares method using source
    let sumY = 0
    let sumX = 0
    let sumXY = 0
    let sumX2 = 0
    let sumY2 = 0

    for (var i = 0; i < length; i++) {
        sumY += source[i]
        sumX += i
        sumXY += source[i] * i
        sumY2 += Math.pow(source[i], 2)
        sumX2 += Math.pow(i, 2)
    }

    //Slope
    let slope = ((length * sumXY) - sumX * sumY) / ((length * sumX2) - Math.pow(sumX, 2))

    //Intercept
    let intercept = ((sumY - slope * sumX) / length)

    //Linear regression function
    let Y = intercept + slope * (length - 1 - offset)

    return Y
}

