}


function crossover(value1, value1prev, value2, value2prev) {
    // a replication of TradingView's crossover() function

    let result = false
    //check 1prev under 2prev and value1 over value2
    if (value1prev < value2prev && value1 > value2) {
        result = true
    }
    return result
}

function crossunder(value1, value1prev, value2, value2prev) {
